// src/components/ViewerManagement.js
import React from 'react';

const ViewerManagement = ({ onAddViewer, onRemoveViewer, onViewViewers, onBack }) => (
  <div>
    <h2>Manage Viewers</h2>
    <button onClick={onAddViewer}>Add Viewer</button>
    <button onClick={onRemoveViewer}>Remove Viewer</button>
    <button onClick={onViewViewers}>View Viewers</button>
    <button onClick={onBack}>Back to Admin Options</button>
  </div>
);

export default ViewerManagement;
